import React from "react";
import logo from "../../Assets/Logo.png";

const Header = () => {
  return (
    <div className="flex flex-col">
      <div className="bg-[#EDEDDD] flex flex-col space-y-20">
        <div className="w-[177px] h-[53.52px] ml-32 pt-4">
          <img src={logo} alt="Logo" className="w-full h-full object-contain" />
        </div>
        <div className=" ml-40">
          <p>Making Trade Documents Digital</p>
        </div>
      </div>
    </div>
  );
};

export default Header;
